import React from 'react';

// COMPONENTS
import Header from '../components/Common/Header';
import Button from '../components/Common/Button';

const IndexPage = () => {
    return (
        <>
            <Header />
            <Button primary>Create post</Button>
            <Button>More</Button>
        </>
    );
};

export default IndexPage;
